    return (
      <section>
        <h1>Insira seu Login</h1>
        <div>
          <input
            type="email"
            placeholder="Email"
            data-testid="email-input"
            required
          />
          <input
            type="password"
            placeholder="Senha"
            data-testid="password-input"
            minLength="6"
            required
          />
          <button type="button" onClick={ history.push('/carteira') }>
            Entrar
          </button>
        </div>
      </section>
    );
  }
}
